import styled from "styled-components";

export default function Header() {
  return (
    <HeaderWrapper>
      <HeaderTitle>자취생은 매일매일 점심이 고민이다</HeaderTitle>
      <ResetBtn>처음으로</ResetBtn>
    </HeaderWrapper>
  );
}

const HeaderWrapper = styled.header`
  display: flex;
  justify-content: space-between; /* Changed from center to space-between */
  align-items: center;
  padding: 0 20px; /* Added padding for spacing, adjust as needed */
`;

const HeaderTitle = styled.h1`
  /* Your styles for HeaderTitle */
`;

// ResetBtn should not be an h1, it should be a button
const ResetBtn = styled.button`
  /* Your styles for ResetBtn */
  cursor: pointer; /* Typically you want a cursor for buttons */
`;
